import React from 'react';
import EditIcon from '@material-ui/icons/Edit';

const EditButton = ({ setShowForm }) => {
  return (
    <div>
      <button onClick={setShowForm((prev) => !prev)}>
        <EditIcon />
      </button>
    </div>
  );
};

export default EditButton;
